api_info:
基础信息

接口地址

https://ditmapi.zjdex.com/APIService/KI/getEmIndByName

支持格式

json

请求方式

post

请求示例

https://ditmapi.zjdex.com/APIService/KI/getEmIndByName

接口备注

请求头参数

字段| 必填| 数据类型| 示例值| 说明  
---|---|---|---|---  
orderid|  true | String| 2021110417170430000004| 购买商品对应的订单编号  
token|  true | String| | 验证加密值 Md5(publicKey+timestamp+privateKey) 加密的32位大写字符串  
timestamp|  true | String| | 精确到毫秒的Unix时间戳  
publicKey|  true | String| | 本平台分配的开发者公钥  
content-type|  true | String| application/json; charset=UTF-8| 请使用UTF-8编码  

请求参数

字段| 必填| 数据类型| 示例值| 说明  
---|---|---|---|---  
name|  是 | String| 企业全名/注册号/统一社会信用代码| 企业全名/注册号/统一社会信用代码  

返回参数说明

字段| 数据类型| 说明  
---|---|---  
message| String| 返回结果消息  
sign| String| 数据签名  
data| Object| 查询结果返回  

字段| 数据类型| 说明  
---|---|---  
total|  number| 返回列表中记录总数  
num|  number| 本次调用返回记录数  
items|  array| 新兴产业分类列表  
category_path|  string| 企业所属的产业分类路径  

