detail_description:
应用场景：

   一体机办件量信息记录了一体机设备的经纬度信息、一体机相隔最短距离、部署密集程度、部署合理性判定。

   这些信息可用作分析绍兴市一体机点位部署及相隔距路，最终可根据数据调整一体机部署点位及数量。

算法规则简要说明：

根据一体机点位信息中的经纬度信息，配合getdistance函数进行点位间距计算，并对所有一体机信息都进行全量重复比对，得出彼此间的相隔距离，并选择其中的相隔最短距离。

   getdistance函数如下：

   function getDistance($lat1, $lng1, $lat2, $lng2)

   {

   $earthRadius = 6367000;

   $lat1 = ($lat1 * pi() ) / 180;

   $lng1 = ($lng1 * pi() ) / 180;

   $lat2 = ($lat2 * pi() ) / 180;

   $lng2 = ($lng2 * pi() ) / 180;

   $calcLongitude = $lng2 - $lng1;

    $calcLatitude = $lat2 - $lat1;

   $stepOne = pow(sin($calcLatitude / 2), 2) + cos($lat1) * cos($lat2) *
pow(sin($calcLongitude / 2), 2);

   $stepTwo = 2 * asin(min(1, sqrt($stepOne)));

   }

